import  { useState } from 'react';
import { Box, Typography } from '@material-ui/core';
import PauseIcon from '@mui/icons-material/Pause';
import PlayArrowIcon from '@mui/icons-material/PlayArrow';

import '../styling/currentlyPlayingDesktop.css';


import Ctrl from '../ctrl.jpg';


const CurrentlyPlayingDesktop = () => {
  const [playing, setPlaying] = useState(false);

  const handleSetPlaying = () => {
    setPlaying(!playing)
  };


  return(
    <Box
      id='currently-playing-desktop'
      bgcolor='red'
    >
     hello
      {playing ? <PlayArrowIcon onClick = {() => handleSetPlaying()} style={{ 'alignSelf': 'center', color: '#1DB954', backgroundColor: 'black'}}/> : <PauseIcon onClick = {() => handleSetPlaying()} style={{ 'alignSelf': 'center', color: '#1DB954', backgroundColor: 'black'}}/>}
    </Box>
    )
}

export default CurrentlyPlayingDesktop;
